
public class ValidAnagram {
	
	public static void main(String args[]) {
		//isValidAnagram("anagram","nagaram");
		isValidAnagram("","");
	}
	
	public static void isValidAnagram(String s, String t) {
		char chStrArray1 [] = s.toCharArray();
		char chStrArray2 [] = t.toCharArray();
		
		boolean isAnagram = false;
		System.out.println(t);
		
		if(s.length() == t.length()) {
			
			//Arrays.sort(chStrArray1);
			//Arrays.sort(chStrArray2);
			
			for(int i = 0;i < chStrArray1.length;i++) {
				for(int j = i+1;j < chStrArray1.length;j++) {
					
					if(chStrArray1[i] > chStrArray1[j]) {
						char temp = chStrArray1[j];
						chStrArray1[j] = chStrArray1[i];
						chStrArray1[i] = temp;
					}
				}
			}
			
			for(int i = 0;i < chStrArray2.length;i++) {
				for(int j = i+1;j < chStrArray2.length;j++) {
					
					if(chStrArray2[i] > chStrArray2[j]) {
						char temp = chStrArray2[j];
						chStrArray2[j] = chStrArray2[i];
						chStrArray2[i] = temp;
					}
				}
			}
			
			for(int i = 0;i < chStrArray2.length;i++) {
				System.out.print(chStrArray2[i]+" ");
			}
			
			
			for(int i=0, j=0;i < chStrArray1.length && j < chStrArray1.length;i++, j++) {
				if(chStrArray1[i] == chStrArray2[j]) {
					isAnagram = true;
				}
				else {
					isAnagram = false;
					break;
				}
			}
		}
		System.out.println(isAnagram);		
		
	}
}
